import React from 'react';
import styled from 'styled-components';

const Wrapper = styled.div`
  font-family: Roboto;
  font-style: normal;
  margin-top: 100px; /* 간격 띄우기 */

  h2 {
    display: inline;
  }

  span {
    font-family: Roboto;
    font-style: normal;
    font-weight: normal;
    font-size: 20px;
    line-height: 23px;
    display: inline-block;
    float: right;
    letter-spacing: -0.015em;
  }
`;

const Gather = (props) => { // N개의 독서 모임
  return (
    <>
      <Wrapper>
        <div>
          <h2>N개의 독서 모임</h2>
          <span>
            모집중
            최신순
          </span>
        </div>
      </Wrapper>
      <h4>이하 컴포넌트</h4>
    </>
  )
};

export default Gather;
